import React from 'react';
import Layout from '../components/Layout';
import Link from 'next/link'

const App = () => (
  <div>
    <Layout>
      <h2>Index Page</h2>
      <a href="/signin">SIGNIN</a>
      <a href="/signup">SIGNUP</a>
    </Layout>
  </div>
);

export default App;
